import { Button, Form, Input } from "antd";

export const NewTargetScreen: React.FC = () => {
  const onFinishForm = (values: any) => {
    console.log(values);
  };

  return (
    <div>
      <Form onFinish={onFinishForm}>
        <Form.Item label="Nome da meta" name="name">
          <Input />
        </Form.Item>

        <Form.Item label="Quantidade">
          <Input type="number" name="quantity" />
        </Form.Item>

        <Form.Item label="Unidade">
          <Input name="quantity" />
        </Form.Item>

        <Form.Item label="Prazo">
          <Input type="date" name="prazo" />
        </Form.Item>

        <Form.Item label="Valor inicial">
          <Input type="number" name="initial_value" />
        </Form.Item>

        <Form.Item>
          <Button type="primary" htmlType="submit">
            Salvar
          </Button>
        </Form.Item>
      </Form>
    </div>
  );
};
